import 'package:json_annotation/json_annotation.dart';part 'uniform_dto.g.dart';@JsonSerializable(ignoreUnannotated: false)class UniformDto {  @JsonKey(name: 'id')  final int? id;  @JsonKey(name: 'name')  final String? name;  @JsonKey(name: 'jobUniformDetails')  final List<JobUniformDetail>? jobUniformDetails;  UniformDto({this.id, this.name, this.jobUniformDetails});  factory UniformDto.fromJson(Map<String, dynamic> json) => _$UniformDtoFromJson(json);  Map<String, dynamic> toJson() => _$UniformDtoToJson(this);}@JsonSerializable(ignoreUnannotated: false)class JobUniformDetail {  @JsonKey(name: 'jobUniformId')  final int? jobUniformId;  @JsonKey(name: 'uniFormImage')  final String? uniFormImage;  @JsonKey(name: 'description')  final String? description;  JobUniformDetail({this.jobUniformId, this.uniFormImage, this.description});  factory JobUniformDetail.fromJson(Map<String, dynamic> json) => _$JobUniformDetailFromJson(json);  Map<String, dynamic> toJson() => _$JobUniformDetailToJson(this);}